import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { connect } from "react-redux";
import { logoutUser } from "../../utilities/actions/auth";
import { ScrollView } from "react-native-gesture-handler";
import AppPaddedView from "../../components/UI/AppPaddedView";
import appValues from "../../constants/appValues";
import ProfileItem from "./components/ProfileItem";
import architects from "../../data/architects";
import Spacing from "../../components/Spacing";
import { AppSearchBar } from "../../components/AppSearchBar";
import states from "../../data/states";
import AppButton from "../../components/UI/AppButton";

function Home() {
  return (
    <View style={{ flex: 1, backgroundColor: "#fff" }}>
      <ScrollView>
        <AppPaddedView>
          <Spacing size={50} />
          <Text style={{ fontSize: appValues.font.h1, fontWeight: "700" }}>
            Architects
          </Text>
          <Spacing size={10} />
          <Text style={{ fontSize: appValues.font.h3 }}>
            Connect with your dream architect
          </Text>
          <Spacing size={20} />
          <Spacing size={20} />
        </AppPaddedView>
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({});

const mapStateToProps = (state) => {
  const { auth } = state;
  return { auth };
};

const mapDispatchToProps = (dispatch) => {
  return {
    logoutUser: () => dispatch(logoutUser()),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Home);
